selector_to_html = {"a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ausgabeformat<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Um das Scan-Daten\u00fcbertragungsformat zu \u00e4ndern, scannen Sie einen der acht Strichcodes entsprechend dem gew\u00fcnschten Format.</p>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#standdard-25-iata-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standdard 25/IATA 25<a class=\"headerlink\" href=\"#standdard-25-iata-25\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id61\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Akku-Informationen<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#clear-pairing-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kopplungsinformationen l\u00f6schen<a class=\"headerlink\" href=\"#clear-pairing-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Suffix hinzuf\u00fcgen<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#nec-25-coop25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">NEC-25(COOP25)<a class=\"headerlink\" href=\"#nec-25-coop25\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id91\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#d-reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Umkehr-Symbologien<a class=\"headerlink\" href=\"#d-reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-spp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth-SPP<a class=\"headerlink\" href=\"#bluetooth-spp\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pr\u00e4fix<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Pr\u00e4fix hinzuf\u00fcgen<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan-Modus<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"barcode.html#pdf417\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">PDF417<a class=\"headerlink\" href=\"#pdf417\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id80\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#maxi-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Maxi Code<a class=\"headerlink\" href=\"#maxi-code\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id86\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Normaler Modus<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatureinstellungen<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Fall Einstellungen<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Drahtlos-Modus<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Dieser Modus verwendet die 2. GHz-Frequenzband f\u00fcr die Daten\u00fcbertragung und basiert auf Funkfrequenz-Technologie (RF) , der \u00fcber einen USB-Empf\u00e4nger mit dem Computer verbunden ist und es dem Scanner erlaubt, sich innerhalb einer bestimmten Entfernung frei zu bewegen.</p>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id67\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">2D Symbologien<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Speichermodus<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Daten hochladen<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrix 25<a class=\"headerlink\" href=\"#matrix-25\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id55\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#isbt-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISBT 128<a class=\"headerlink\" href=\"#isbt-128\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"uhfmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">UHF-Einstellung<a class=\"headerlink\" href=\"#uhf-setting\" title=\"Link to this heading\">#</a></h1><h2>Modulauswahl<a class=\"headerlink\" href=\"#module-selection\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">One-to-One Paarung<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-keyboard-transmission-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth-Tastatur \u00dcbertragungsgeschwindigkeit<a class=\"headerlink\" href=\"#bluetooth-keyboard-transmission-speed\" title=\"Link to this heading\">#</a></h2><h3>Hohe Geschwindigkeit<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#data-matrix-dm\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">DatenMatrix(DM)<a class=\"headerlink\" href=\"#data-matrix-dm\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id83\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#bluetooth-ble\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth BLE<a class=\"headerlink\" href=\"#bluetooth-ble\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id20\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lautst\u00e4rke-Einstellungen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scannen Sie den entsprechenden Einstellungscode, um die Sound-Eingabeaufforderung des Scanners einzu-/auszuschalten</p>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Set ausblenden<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Barcode Startzeichen ausblenden<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#bluetooth-hid\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth-HID<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-rss\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 Datenleiste/RSS<a class=\"headerlink\" href=\"#gs1-databar-rss\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id79\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u00dcbertrage Code ID Zeichen<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Ein Code-ID-Zeichen identifiziert den Code-Typ eines gescannten Barcodes. Dies kann n\u00fctzlich sein, wenn mehrere Code-Typen dekodiert werden. Das Code-ID-Zeichen wird zwischen dem Pr\u00e4fix Zeichen (falls ausgew\u00e4hlt) und dem dekodierten Symbol eingef\u00fcgt.</p>", "a[href=\"barcode.html#han-xin-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Han Xin COde<a class=\"headerlink\" href=\"#han-xin-code\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id88\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatursprache<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Aktuelle Tastatursprache abrufen<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"barcode.html#msi-msi-plessey\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI/MSI Plessey<a class=\"headerlink\" href=\"#msi-msi-plessey\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id73\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Automatischer Sensormodus<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Im Automatik-Sensing-Modus erkennt der Scanner die Helligkeit der umgebenden Umgebung. Wenn sich die Helligkeit \u00e4ndert, wird der Scan ausgel\u00f6st. Der Scan endet wenn der Scan erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcbersteigt. Unabh\u00e4ngig davon, ob der letzte Scan erfolgreich war oder fehlgeschlagen ist, wird die Helligkeit der umgebenden Umgebung erneut erkannt.</p>", "a[href=\"barcode.html#qr-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">QR Code<a class=\"headerlink\" href=\"#qr-code\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id81\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#brazil-bank-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Brasilien-Bankleitzahl<a class=\"headerlink\" href=\"#brazil-bank-code\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#ios-popup-hide-keyboard\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">IOS Popup/Verstecke Tastatur<a class=\"headerlink\" href=\"#ios-popup-hide-keyboard\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologien<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Alle Symbole<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#ds-8500-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>DS-8500</strong> Wireless Scanner Kurzanleitung<a class=\"headerlink\" href=\"#ds-8500-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Symbologien<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Systemeinstellungen<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"uhfmode.html#pass-through-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Durchleitungsmodus<a class=\"headerlink\" href=\"#pass-through-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#issn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISSN<a class=\"headerlink\" href=\"#issn\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id90\" title=\"Link to this heading\">#</a></h3><p>In EAN13 umwandeln, wenn deaktiviert</p>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id37\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id33\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Niedrige Geschwindigkeit<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"uhfmode.html#module-selection\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modulauswahl<a class=\"headerlink\" href=\"#module-selection\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Arbeitsmodus<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Im Arbeitsbereich au\u00dferhalb des Bereichs 2. G Empf\u00e4nger oder Bluetooth Signal k\u00f6nnen Sie den Speichermodus des Scanners aktivieren, indem Sie die unten beschriebenen Schritte befolgen. In diesem Modus werden alle gescannten Daten direkt im Scanner gespeichert. Vor dem Hochladen der Daten Es wird dauerhaft im Scanner gespeichert, so dass Sie die Daten hochladen k\u00f6nnen, wenn sich der Scanner im Empfangs-Signalbereich befindet.</p>", "a[href=\"barcode.html#digital-barcode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Digitaler Barcode<a class=\"headerlink\" href=\"#digital-barcode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"uhfmode.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ausgabeformat<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><h3>ASCII (Hex)<a class=\"headerlink\" href=\"#ascii-hex\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Schnelleinstellung<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Pr\u00e4fix hinzuf\u00fcgen<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kontinuierlicher Modus<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Wenn der Scanner erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcberschreitet, endet der aktuelle Scanner. Wenn die Zeit die angegebene Zeit \u00fcberschreitet, wird der n\u00e4chste Scan automatisch ausgel\u00f6st.</p>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mittlere Geschwindigkeit<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#discrete-2-of-5-industrial-2-of-5-ind25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Diskret 2 von 5/Industrial 2 von 5/IND25<a class=\"headerlink\" href=\"#discrete-2-of-5-industrial-2-of-5-ind25\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id49\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-128-ucc-ean-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1-128 (UCC/EAN-128)<a class=\"headerlink\" href=\"#gs1-128-ucc-ean-128\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth-Modus<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1><h2>Bluetooth-HID<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Gleiche Code-Verz\u00f6gerung Einstellungen<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>Um zu verhindern, dass der gleiche Barcode mehrfach im <a class=\"reference internal\" href=\"#continuous-mode\">kontinuierlichen Modus</a> und <a class=\"reference internal\" href=\"#auto-sensing-mode\">Automatischer Erkennungsmodus</a>, Sie k\u00f6nnen verlangen, dass der Scanner auf eine eingestellte Verz\u00f6gerung wartet, bevor der gleiche Barcode gescannt werden kann.</p>", "a[href=\"barcode.html#interleaved-2-of-5-itf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interleaved 2 von 5/ITF<a class=\"headerlink\" href=\"#interleaved-2-of-5-itf\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id43\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alle Symbole<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"uhfmode.html#uhf-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UHF-Ausl\u00f6semodus<a class=\"headerlink\" href=\"#uhf-trigger-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barcodes mit URLs blockieren<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Blockiere das Scannen von URL-QR-Codes, beginnend mit <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Datenbearbeitung<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Ausgabeformat<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Um das Scan-Daten\u00fcbertragungsformat zu \u00e4ndern, scannen Sie einen der acht Strichcodes entsprechend dem gew\u00fcnschten Format.</p>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Hohe Geschwindigkeit<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#aztec-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aztec Code<a class=\"headerlink\" href=\"#aztec-code\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id87\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Holen Sie sich die Firmware-Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Anhang<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>Numerische Barcodes<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Empfangs-Tastatur\u00fcbertragungsgeschwindigkeit<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fall Einstellungen<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#modify-bluetooth-name\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth-Name \u00e4ndern<a class=\"headerlink\" href=\"#modify-bluetooth-name\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Schlafzeit<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Durch das Scannen des folgenden Einstellungscodes Sie k\u00f6nnen den Scanner so einstellen, dass er nach einer bestimmten Zeit in den Schlafmodus wechselt, wenn kein Code gescannt wird, um den Stromverbrauch zu reduzieren.</p>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Charakter<a class=\"headerlink\" href=\"#character\" title=\"Link to this heading\">#</a></h1><h2>End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"barcode.html#composite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">COMPOSITE<a class=\"headerlink\" href=\"#composite\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id98\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-32\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 32<a class=\"headerlink\" href=\"#code-32\" title=\"Link to this heading\">#</a></h2><h3>Code 39 zu Code 32 konvertieren (italienischer pharmazeutischer Code)<a class=\"headerlink\" href=\"#convert-code-39-to-code-32-italian-pharmaceutical-code\" title=\"Link to this heading\">#</a></h3><p>Code 32 ist eine von der italienischen pharmazeutischen Industrie verwendete Variante des Kodex 39. Scannen Sie den entsprechenden Barcode unten, um die Umwandlung von Code 39 in Code 32 zu aktivieren oder zu deaktivieren.</p>", "a[href=\"barcode.html#bookland-ean-isbn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bookland (ISBN)<a class=\"headerlink\" href=\"#bookland-ean-isbn\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
